        methods: {
            handleMouseOver (e) {
                const ref = e.target.getBoundingClientRect()
                this.x = ref.x - this.wrap.x - ref.width / 2 - 90
                this.y = ref.y - this.wrap.y - ref.height / 2
                // console.info(refs.x, refs.y, ref.x, ref.y)
                this.popoverInstance = this.$bkPopover(e.target, {
                    content: 'sdfsdfsdf',
                    arrow: true,
                    placement: 'top',
                    maxWidth: 520
                })
                // .instances[0]
                this.active = 1
            },
            handleMouseLeave (e) {
                this.active = 0
                this.popoverInstance && this.popoverInstance.hide()
            }
        }
